  IdMovimientoAlmacen BIGINT(20) NOT NULL AUTO_INCREMENT,
  IdTipoMovimientoAlmacen INT(11) NOT NULL,
  IdProducto BIGINT(20) NOT NULL,
  IdUnidadBase INT(11) NOT NULL,
  Cantidad DECIMAL(15, 6) NOT NULL,
  CostoUnitario DECIMAL(15, 6) NOT NULL,
  CostoTotal DECIMAL(15, 6) NOT NULL,
  IdComprobante BIGINT(20) DEFAULT NULL,
  PRIMARY KEY (IdMovimientoAlmacen),
  INDEX FK_almt13_movimiento_almacen_almt05_producto_IdProducto (IdProducto),
  INDEX FK_almt13_movimiento_almacen_IdTipoMovimientoAlmacen (IdTipoMovimientoAlmacen),
