--
-- Definition for procedure ALMSPRABMCategoria
--
CREATE PROCEDURE ALMSPRABMCategoria(IN pAbm TINYINT,
IN pIdCategoria INT,
IN pCodigo VARCHAR(5),
IN pDescripcion VARCHAR(45),
 IN pIdRubro INT)
BEGIN

DECLARE CodGenerado    VARCHAR(3);

  IF pAbm = 1 THEN


    SET CodGenerado:=
    (select ALMFNCCNSObtenerCodigo((Select (UltimoCorrelativoCategoria+1) from almt01_rubro where IdRubro=pIdRubro),2));


    UPDATE almt01_rubro

    SET UltimoCorrelativoCategoria=CAST(CodGenerado AS DECIMAL(4,0))

    where IdRubro=pIdRubro;

  ELSE
    IF pAbm = 2 THEN
      UPDATE
        almt02_categoria
      SET
        Descripcion = pDescripcion
      WHERE
        IdCategoria = pIdCategoria;
    ELSE
      IF pAbm = 3 THEN
        DELETE
        FROM
          almt02_categoria
        WHERE
          IdCategoria = pIdCategoria;
      END IF;
    END IF;
  END IF;
END
$$

