--
-- Definition for procedure ALMSPRABMProductoPrecio
--
CREATE PROCEDURE ALMSPRABMProductoPrecio(
  pABM int,
  pIdProductoPrecio bigint,
  pIdUnidadMedidaProducto bigint,
  pIdUnidadMedidaVenta int,
  pIdProducto bigint,
  pRangoInicial DECIMAL(10,2),
  pRangoFinal DECIMAL(10,2),
  pRangoFaltante  VARCHAR(300),
  pPrecioUnitario DECIMAL(10,3)
)
BEGIN
    IF pABM=1
    THEN
        IdUnidadMedidaVenta,
        IdProducto, 
        RangoInicial,
        RangoFinal,
        RangoFaltante, 
        PrecioUnitario)
        values 
        (
        pIdUnidadMedidaProducto,
        pIdUnidadMedidaVenta, 
        pIdProducto, 
        pRangoInicial, 
        pRangoFinal, 
        pRangoFaltante, 
        pPrecioUnitario
        );
    else 
      IF pABM=2
    THEN
      UPDATE
      almt16_producto_precio
      SET
      IdUnidadMedidaProducto =pIdUnidadMedidaProducto , 
      IdUnidadMedidaVenta = pIdUnidadMedidaVenta, 
      IdProducto =pIdProducto , 
      RangoInicial = pRangoInicial, 
      RangoFinal = pRangoFinal, 
      RangoFaltante =pRangoFaltante,
      PrecioUnitario =pPrecioUnitario 
      WHERE
        IdProductoPrecio =pIdProductoPrecio;
    else
       IF pABM=3 THEN
       DELETE FROM
       almt16_producto_precio
       WHERE
      IdProductoPrecio =pIdProductoPrecio;
    end if;
end if;
end if;
END
$$

