--
-- Definition for procedure ALMSPRCalcularCostoPromedio
--
CREATE PROCEDURE ALMSPRCalcularCostoPromedio(
  pIdProducto BIGINT,
  pCantidad   DECIMAL(10,2),
  pCostoUnitario DECIMAL(10,2),
  pIdUnidadMedida INT,
  pIdAlmacen TINYINT,
inout pcostoUnitarioCalculado DECIMAL(10,2),
  pIdTipoMovimientoAlmacen INT
  )
BEGIN

DECLARE vUltimocostoUnitario DECIMAL(10,2);
DECLARE vStockReal DECIMAL(10,2);
DECLARE vCantidadTotal DECIMAL(10,2);


 SET vUltimocostoUnitario:=(SELECT CostoUnitario FROM almt09_almacen_producto
                            WHERE IdProducto=pIdProducto AND IdAlmacen =pIdAlmacen);
 SET vStockReal:=(SELECT  StockReal FROM almt09_almacen_producto
                            WHERE IdProducto=pIdProducto AND IdAlmacen =pIdAlmacen);

 SET vCantidadTotal:=COALESCE((SELECT EquivalenciaConBase FROM almt15_unidad_medida_producto
                                       WHERE IdProducto = pIdProducto and IdUnidadMedidaVenta=pIdUnidadMedida)  
                                       AND SiNoUnidadBase =FALSE
                              ,1)*pCantidad;

if pIdTipoMovimientoAlmacen=1 then

SET pcostoUnitarioCalculado=((pCostoUnitario*vCantidadTotal+(vStockReal*vUltimocostoUnitario))/(vStockReal+pCantidad));

else 
SET pcostoUnitarioCalculado=vUltimocostoUnitario;
end if;

END
$$

