--
-- Definition for procedure ALMSPRCNSMarca
--
CREATE PROCEDURE ALMSPRCNSMarca(pIdConsulta int,pIdSubfamilia int, pIdMarca int,marca VARCHAR(50),pIdFamilia INT,pIdCategoria INT, pIdRubro int)
BEGIN

    if pIdConsulta=1
    THEN
      SELECT        
        t06.IdMarca,
        t06.Descripcion
      FROM
        almt05_producto t05
        INNER JOIN almt06_marca t06
          ON t05.IdMarca = t06.IdMarca
        INNER JOIN almt04_subfamilia t04
          ON t05.IdSubfamilia = t04.IdSubfamilia
      WHERE t05.IdSubfamilia=pIdSubfamilia and t05.IdFamilia=pIdFamilia and t05.IdCategoria=pIdCategoria and t05.IdRubro=pIdRubro
        group by t06.IdMarca
        order by t06.Descripcion;
    
  ELSE
  IF pIdConsulta=2
    THEN
    select * from almt06_marca t06 where t06.Descripcion like CONCAT(marca,"%") order by t06.Descripcion asc;
    end if;
  END IF;
END
$$

--
-- Definition for procedure ALMSPRCNSProducto
--
CREATE PROCEDURE ALMSPRCNSProducto(
  pIdCns INT,
  pIdMarca INT,
  pIdSubfamilia INT,
  pIdProducto bigint,
  pParametro varchar(500))
BEGIN
  if pIdCns=1
  THEN
    select t05.IdProducto,
    t05.Descripcion,t05.Codigo,t05.SiNoImpuesto,t05.IdUnidadMedidaBase,t05.IdUnidadPresentacionVenta from almt05_producto t05 where t05.IdMarca=pIdMarca and t05.IdSubfamilia=pIdSubfamilia;
    else if pIdCns=2
          THEN
            select IdUnidadBase,CantidadBase,IdUnidadPedido,CantidadPedido,t05.IdEquivalenciaUnidad
              from almt12_equivalencia_unidad t05 where t05.IdProducto=pIdProducto;          
        else
        if pIdCns=3
        THEN
        select alm.IdProducto,
               alm.`Cod.Producto`,
               alm.Producto,
               alm.Marca,
               alm.UMBAbr,
               alm.`Und.Prest.`,
               alm.Subfamilia,
               alm.Familia,
               alm.Categoria,
               alm.Rubro,
               alm.SiNoImpuesto,
               alm.IdMarca,
               alm.IdSubfamilia,
               alm.IdFamilia,
               alm.IdCategoria,
               alm.IdRubro,
               alm.IdUnidadMedidaBase,
               alm.IdUnidadPresentacionVenta,
               alm.`PrecioReferencia`
        from almviwcnsproducto alm
          order by alm.Producto asc;
          ELSE
          if pIdCns=4
        THEN
        select alm.IdProducto,
               alm.`Cod.Producto`,
               alm.Producto,
               alm.Marca,
               alm.UMBAbr,
               alm.`Und.Prest.`,
               alm.Subfamilia,
               alm.Familia,
               alm.Categoria,
               alm.Rubro,
               alm.SiNoImpuesto,
               alm.IdMarca,
               alm.IdSubfamilia,
               alm.IdFamilia,
               alm.IdCategoria,
               alm.IdRubro,
               alm.IdUnidadMedidaBase,
               alm.IdUnidadPresentacionVenta,
               alm.`PrecioReferencia`
        from almviwcnsproducto alm
          where alm.`Cod.Producto`like concat('%',pParametro,'%')
          order by alm.Producto asc;
              ELSE
          if pIdCns=5
        THEN
        select alm.IdProducto,
               alm.`Cod.Producto`,
               alm.Producto,
               alm.Marca,
               alm.UMBAbr,
               alm.`Und.Prest.`,
               alm.Subfamilia,
               alm.Familia,
               alm.Categoria,
               alm.Rubro,
               alm.SiNoImpuesto,
               alm.IdMarca,
               alm.IdSubfamilia,
               alm.IdFamilia,
               alm.IdCategoria,
               alm.IdRubro,
               alm.IdUnidadMedidaBase,
               alm.IdUnidadPresentacionVenta,
               alm.`PrecioReferencia`
        from almviwcnsproducto alm
          where alm.Marca like concat('%',pParametro,'%')
          order by alm.Producto asc;
                ELSE
          if pIdCns=6
        THEN
        select alm.IdProducto,
               alm.`Cod.Producto`,
               alm.Producto,
               alm.Marca,
               alm.UMBAbr,
               alm.`Und.Prest.`,
               alm.Subfamilia,
               alm.Familia,
               alm.Categoria,
               alm.Rubro,
               alm.SiNoImpuesto,
