--
-- Definition for procedure ALMSPRINSMovimientoAlmacen
--
CREATE PROCEDURE ALMSPRINSMovimientoAlmacen(IN pIdProducto BIGINT, 
  IN pCantidad DECIMAL(10,2),
  IN pCostoUnitario DECIMAL(10,2),
  IN pIdUnidadMedida INT,
  IN pIdAlmacen TINYINT,  
  IN pIdTipoMovimientoAlmacen INT,
  IN pIdComprobanteVenta BIGINT)
BEGIN

DECLARE vUltimocostoUnitario DECIMAL(10,2);
DECLARE vStockReal DECIMAL(10,2);
DECLARE vCantidadTotal DECIMAL(10,2);
DECLARE vcostoUnitarioCalculado DECIMAL(10,2);


 SET vUltimocostoUnitario:=(SELECT CostoUnitario FROM almt09_almacen_producto
                            WHERE IdProducto=pIdProducto AND IdAlmacen =pIdAlmacen);
 SET vStockReal:=(SELECT  StockReal FROM almt09_almacen_producto
                            WHERE IdProducto=pIdProducto AND IdAlmacen =pIdAlmacen);

 SET vCantidadTotal:=COALESCE((SELECT EquivalenciaConBase FROM almt15_unidad_medida_producto
                                       WHERE IdProducto = pIdProducto and IdUnidadMedidaVenta=pIdUnidadMedida 
                                       AND  SiNoUnidadBase=FALSE)
                              ,1)*pCantidad;

if pIdTipoMovimientoAlmacen   = 1 then

SET vcostoUnitarioCalculado=((pCostoUnitario*vCantidadTotal+(vStockReal*vUltimocostoUnitario))/(vStockReal+pCantidad));

UPDATE almt09_almacen_producto SET
    CostoUnitario=vcostoUnitarioCalculado ,
    StockReal = StockReal+vCantidadTotal,
    Inventario =StockReal*vcostoUnitarioCalculado
   WHERE IdProducto=pIdProducto AND IdAlmacen =pIdAlmacen
    ;
else 
SET vcostoUnitarioCalculado=vUltimocostoUnitario;
  UPDATE almt09_almacen_producto SET
    CostoUnitario=vcostoUnitarioCalculado ,
    StockReal = StockReal-vCantidadTotal,
    Inventario =StockReal*vcostoUnitarioCalculado
   WHERE IdProducto=pIdProducto AND IdAlmacen =pIdAlmacen
    ;
end if;

  IdUnidadBase, Cantidad, CostoUnitario,
  CostoTotal,IdComprobante)
  VALUES (pIdTipoMovimientoAlmacen,pIdProducto,
  pIdUnidadMedida,pCantidad,pCostoUnitario,pCantidad*pCostoUnitario,
  pIdComprobanteVenta);


  



END
$$

--
-- Definition for procedure ALMSPRINSProducto
--
CREATE PROCEDURE ALMSPRINSProducto(
  pIdUnidadMedidaBase int,
  pDescripcion varchar(300),
  pIdSubfamilia INT,
  pIdFamilia INT,
  pIdCategoria INT,
  pIdRubro INT,
  pIdMarca int,
  inOUT pIdProducto BIGINT,
  pSiNoImpuesto boolean,
  pCodigo VARCHAR(11),
  pIdUnidadPresentacionVenta int
  
  )
BEGIN
  
  DECLARE CodGenerado    VARCHAR(3);
  SET CodGenerado:= (select ALMFNCCNSObtenerCodigo((Select (UltimoCorrelativoProducto+1) from almt04_subfamilia where IdSubfamilia=pIdSubfamilia),2));
  
  values (pIdUnidadMedidaBase,CONCAT(pCodigo,CodGenerado),pDescripcion,pIdSubfamilia,pIdFamilia,pIdCategoria,pIdRubro,pIdMarca,pSiNoImpuesto,pIdUnidadPresentacionVenta);
  UPDATE almt04_subfamilia
  SET UltimoCorrelativoProducto=CAST(CodGenerado AS DECIMAL(4,0))
  where IdSubfamilia=pIdSubfamilia;
  set  pIdProducto=last_insert_id();
      StockReal, CostoUnitario, Inventario, IdProducto, IdSubfamilia, IdFamilia, 
      IdCategoria, IdRubro, IdMarca, UltimoTipoMovimiento, UltimoIdMovimientoAlmacen, 
      IdAlmacen) 
      VALUES (pIdUnidadMedidaBase,100,100,0,0,pIdProducto,1,1,1,1,1,1,1,1);

END
$$

