END
$$

--
-- Definition for procedure CMPSPRCNSOrdenCompra
--
CREATE PROCEDURE CMPSPRCNSOrdenCompra(
 pIdCns TINYINT,
  pIdSucursal INT
  )
BEGIN
  
  if pIdCns=1 -- Ultima 1 dia
    THEN
      SELECT 
         cmpviw.IdOrdenCompra,
        cmpviw.IdProveedor,
        cmpviw.IdSucursal,
        DATE_FORMAT( cmpviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        cmpviw.IdDescuento,
        cmpviw.Descuento,
        cmpviw.DescuentoEnValores,
        cmpviw.DescuentoEnSubTotal,
        cmpviw.DescuentoTotal,
        cmpviw.SubTotalNeto,
        cmpviw.SubTotalNetoSinIGV,
        cmpviw.IGVActual,
        cmpviw.IGV,
        cmpviw.ISC,
        cmpviw.MontoTotal,
        cmpviw.IdTipoComprobante,
        cmpviw.IdCondicion,
        cmpviw.IdMoneda, 
        cmpviw.TipoCambio,  
        cmpviw.Codigo,
        cmpviw.Proveedor,
        cmpviw.Moneda,
        cmpviw.TipoComprobante,        
        cmpviw.Direccion,
        cmpviw.NumeroRUC,
        cmpviw.Condicion,
        cmpviw.`Tipo Descuento`, 
        cmpviw.EmpleadoAbre,
        cmpviw.IdEmpleado,
        cmpviw.Sucursal,
        cmpviw.SubtotalBruto,
        cmpviw.TotalPagar
        FROM cmpviwcnsordencompra cmpviw
      where 
        DATE_SUB(CURDATE(),INTERVAL 1 day)<=cmpviw.Fecha 
        and cmpviw.IdUltimoEstado=1
        order by cmpviw.Fecha asc ;

      else
  if pIdCns=2 -- Ultimo 3 Dia
    THEN
      SELECT 
          cmpviw.IdOrdenCompra,
        cmpviw.IdProveedor,
        cmpviw.IdSucursal,
        DATE_FORMAT( cmpviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        cmpviw.IdDescuento,
        cmpviw.Descuento,
        cmpviw.DescuentoEnValores,
        cmpviw.DescuentoEnSubTotal,
        cmpviw.DescuentoTotal,
        cmpviw.SubTotalNeto,
        cmpviw.SubTotalNetoSinIGV,
        cmpviw.IGVActual,
        cmpviw.IGV,
        cmpviw.ISC,
        cmpviw.MontoTotal,
        cmpviw.IdTipoComprobante,
        cmpviw.IdCondicion,
        cmpviw.IdMoneda, 
        cmpviw.TipoCambio,  
        cmpviw.Codigo,
        cmpviw.Proveedor,
        cmpviw.Moneda,
        cmpviw.TipoComprobante,        
        cmpviw.Direccion,
        cmpviw.NumeroRUC,
        cmpviw.Condicion,
        cmpviw.`Tipo Descuento`, 
        cmpviw.EmpleadoAbre,
        cmpviw.IdEmpleado,
        cmpviw.Sucursal,
        cmpviw.SubtotalBruto,
        cmpviw.TotalPagar   
        FROM cmpviwcnsordencompra cmpviw
      where 
        DATE_SUB(CURDATE(),INTERVAL 3 day)<=cmpviw.Fecha 
        and cmpviw.IdUltimoEstado=1
        order by cmpviw.Fecha asc;
    else
  if pIdCns=3 -- Todos
    THEN
      SELECT 
         cmpviw.IdOrdenCompra,
        cmpviw.IdProveedor,
        cmpviw.IdSucursal,
        DATE_FORMAT( cmpviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        cmpviw.IdDescuento,
        cmpviw.Descuento,
        cmpviw.DescuentoEnValores,
        cmpviw.DescuentoEnSubTotal,
        cmpviw.DescuentoTotal,
        cmpviw.SubTotalNeto,
        cmpviw.SubTotalNetoSinIGV,
        cmpviw.IGVActual,
        cmpviw.IGV,
        cmpviw.ISC,
        cmpviw.MontoTotal,
        cmpviw.IdTipoComprobante,
        cmpviw.IdCondicion,
        cmpviw.IdMoneda, 
        cmpviw.TipoCambio,  
        cmpviw.Codigo,
        cmpviw.Proveedor,
        cmpviw.Moneda,
        cmpviw.TipoComprobante,        
        cmpviw.Direccion,
        cmpviw.NumeroRUC,
        cmpviw.Condicion,
        cmpviw.`Tipo Descuento`, 
        cmpviw.EmpleadoAbre,
        cmpviw.IdEmpleado,
        cmpviw.Sucursal ,
        cmpviw.SubtotalBruto,
        cmpviw.TotalPagar
        FROM cmpviwcnsordencompra cmpviw
      where 
        cmpviw.IdUltimoEstado=1
        order by cmpviw.Fecha asc;
    END IF;
    END IF;
    END IF;
END
$$

