        DATE_FORMAT( vtaviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        vtaviw.Descuento,
        vtaviw.IdTipoComprobante,
        vtaviw.IdCondicion,
        vtaviw.IdMoneda,
        vtaviw.IdDescuento,
        vtaviw.Cliente,
        vtaviw.Direccion,
        vtaviw.DNI,
        vtaviw.EmpleadoAbre,
        vtaviw.IdUltimoEstado,
        tes.Descripcion as Estado,
        vtaviw.SubtotalBruto,
        vtaviw.DescuentoEnSubTotal,
        vtaviw.DescuentoTotal,
