--
-- Definition for procedure CMPSPRINSOrdenCompra
--
CREATE PROCEDURE CMPSPRINSOrdenCompra(IN pIdOrdenCompra BIGINT, 
  IN pIdProveedor BIGINT, 
  IN pIdSucursal TINYINT, 
  IN pDescuento DECIMAL(10, 2),
  IN pSubTotalNeto DECIMAL(10, 2),
  IN pIdUltimoEstado TINYINT, 
  IN pIdTipoComprobante TINYINT,
  IN pIdCondicion TINYINT, 
  IN pIdMoneda TINYINT, 
  IN pIdDescuento TINYINT,
  INOUT pIdOrdenCompra_aux BIGINT,
  INOUT pCodigoOrdenCompra VARCHAR(11), 
  IN pIdEmpleado INT, IN pIdUsuario INT, 
  IN pTipoCambio DECIMAL(10, 3), 
  IN pSubtotalBruto DECIMAL(10, 2),
  IN pDescuentoEnSubTotal DECIMAL(10, 2),
  IN pDescuentoTotal DECIMAL(10, 2),
  IN pDescuentoEnValores DECIMAL(10, 2), 
  IN VIGVActual DECIMAL(10, 2), 
  IN vImporteIGV DECIMAL(10, 2), 
  IN vSubTotalNetoSinIGV DECIMAL(10, 2),
  IN vMontoTotal DECIMAL(10, 2),
  IN pTotalPagar DECIMAL(10, 2))
BEGIN



  SET pCodigoOrdenCompra := (SELECT ALMFNCCNSObtenerCodigo((SELECT (valor + 1)
                                                            FROM
                                                              grlt02_correlativo
                                                            WHERE
                                                              IdCorrelativo = 9), 2));

  UPDATE grlt02_correlativo
  SET
    valor = cast(pCodigoOrdenCompra AS DECIMAL(10, 0))
  WHERE
    IdCorrelativo = 6;

    IGV, isc, SubTotalNetoSinIGV, IdUltimoEstado,IdTipoComprobante,
    IdCondicion, IdMoneda, IdDescuento, Codigo, MontoTotal, 
    IdEmpleado,IdUsuario, IGVActual, TipoCambio, 
    SubtotalBruto, DescuentoEnSubTotal,
    DescuentoTotal, DescuentoEnValores,
    UltimaFecha, UltimoIdUsuario, UltimoIdEmpleado, TotalPagar)
    VALUES (pIdProveedor, pIdSucursal, now(), pDescuento, pSubTotalNeto,
    vImporteIGV, 0, vSubTotalNetoSinIGV, pIdUltimoEstado, pIdTipoComprobante,
    pIdCondicion, pIdMoneda, pIdDescuento, pCodigoOrdenCompra, vMontoTotal,
    pIdEmpleado,pIdUsuario, VIGVActual, pTipoCambio,
    pSubtotalBruto, pDescuentoEnSubTotal,
    pDescuentoTotal, pDescuentoEnValores,
    now(), pIdUsuario, pIdEmpleado, pTotalPagar);

  SET pIdOrdenCompra_aux :=
  (SELECT LAST_INSERT_ID());

  CALL CMPSPRINSOrdenCompraEstado(pIdOrdenCompra_aux, 1, pIdUsuario, pIdEmpleado, '');


END
$$

