--
-- Definition for procedure CMPSPRINSOrdenCompraEstado
--
CREATE PROCEDURE CMPSPRINSOrdenCompraEstado(pIdOrdenCompra    BIGINT,
                                           pIdEstado    INT,
                                           pIdUsuario   INT,
                                           pIdEmpleado  INT,
                                           pdescripcion VARCHAR(250)
                                           )
BEGIN

  IF pIdEstado = 0 THEN -- modificado

    UPDATE cmpt03_orden_compra_estado
    SET
      IdEmpleado = pIdEmpleado, IdUsuario = pIdUsuario, fecha = now()
    WHERE
      IdOrdenCompra = pIdOrdenCompra
      AND IdEstado = 1;
    SET pIdEstado := 1;

  ELSE

  END IF;

  UPDATE cmpt01_orden_compra
  SET
    IdUltimoEstado = pIdEstado, UltimoIdEmpleado = pIdEmpleado, UltimoIdUsuario = pIdUsuario, UltimaFecha = now()
  WHERE
    IdOrdenCompra = pIdOrdenCompra;


END
$$

