--
-- Definition for procedure CMPSPRRPTKardexDeProducto
--
CREATE PROCEDURE CMPSPRRPTKardexDeProducto(
  pIdProducto bigint,
  pIdAlmacen TINYINT 

  )
BEGIN


  SELECT 
    tp.Descripcion,
    tap.StockMinimo,
    tap.StockReal,
    tap.CostoUnitario CUCalculado,
    tap.Inventario,
    tumb.Abreviatura UMP,
    tump.Abreviatura UMB,
    tma.Cantidad,
    tma.CostoUnitario CU,
    tma.CostoTotal ,
    ttm.Descripcion TipoMovimiento
    FROM
    almt13_movimiento_almacen tma,
    almt09_almacen_producto tap,
    almt05_producto tp  ,
    almt08_unidad_medida_venta tump,
    almt08_unidad_medida_venta tumb,
    almt14__tipo_movimiento_almacen ttm
    
    WHERE 
    tma.IdProducto=pIdProducto AND
    tap.IdAlmacen=pIdAlmacen AND
    tap.IdProducto=tp.IdProducto AND
    tma.IdProducto =tap.IdProducto AND
    ttm.IdTipoMovimientoAlmacen=tma.IdTipoMovimientoAlmacen AND

    tap.IdUnidadBase=tumb.IdUnidadMedidaVenta AND
    tma.IdUnidadBase=tump.IdUnidadMedidaVenta 
    ;
END
$$

--
-- Definition for procedure CMRSPRABMAccion
--
CREATE PROCEDURE CMRSPRABMAccion(IN numero INTEGER, IN codigo INTEGER, IN tDescripcion VARCHAR(50), IN tAbreviatura VARCHAR(10))
BEGIN
  CASE numero
  WHEN 2 THEN

    UPDATE
      Grlt08_Accion
    SET
      Abreviatura = tAbreviatura, Descripcion = tDescripcion
    WHERE
      IDACCION = codigo;
  WHEN 3 THEN
    DELETE
    FROM
      Grlt08_Accion
    WHERE
      IdAccion = codigo;

  END CASE;
END
$$

--
-- Definition for procedure CMRSPRABMCliente
--
CREATE PROCEDURE CMRSPRABMCliente(
IN pABM INT,
IN pIdCliente INT,
IN pCodigo VARCHAR(10),
IN pEstado BIT,
IN pApellidoPaterno VARCHAR(25),
IN pApellidoMaterno VARCHAR(25),
IN pNombres VARCHAR(25),
 IN pSexo CHAR(1),
 IN pDireccion VARCHAR(150),
 IN pTelefono VARCHAR(12),
 IN pRUC VARCHAR(12),
 IN pDNI VARCHAR(10),
  IN pCorreo VARCHAR(100),
 IN pIdTipoPersona TINYINT,
  IN pIdSucursal TINYINT,
 IN pCelular  Varchar(12)
 )
BEGIN



  IF pABM = 1 THEN
             Nombre, Sexo, Direccion, Telefono, Numero_DNI, Numero_RUC, Correo,
              IdTipoPersona, IdSucursal,Celular)
               VALUES (UPPER(pCodigo), pEstado, UPPER(pApellidoPaterno),
               UPPER(pApellidoMaterno), UPPER(pNombres), UPPER(pSexo),
               UPPER(pDireccion), UPPER(pTelefono), UPPER(pDNI),UPPER(pRUC),
                UPPER(pCorreo), pIdTipoPersona,
               pIdSucursal,pCelular);
  END IF;

  IF pABM = 3 THEN
    UPDATE
      cmrt01_cliente
    SET
      Codigo = UPPER(pCodigo),
       estado = pEstado,
       ApellidoPaterno = UPPER(pApellidoPaterno),
       ApellidoMaterno = UPPER(pApellidoMaterno),
       Nombre = UPPER(pNombres),
       Sexo = UPPER(pSexo),
       Direccion = UPPER(pDireccion),
       Telefono = UPPER(pTelefono),
       Numero_RUC = UPPER(pRUC),
       Numero_DNI = UPPER(pDNI),
       Correo = UPPER(pCorreo),
       IdTipoPersona = pIdTipoPersona,
       IdSucursal = pIdSucursal,
       Celular=pCelular

    WHERE
      IdCliente = pIdCliente;
  END IF;

  IF pABM = 2 THEN
    UPDATE
      cmrt01_cliente
    SET

      Estado = FALSE
    WHERE
      IdCliente = pIdCliente;
  END IF;





END
$$

