--
-- Definition for procedure CMRSPRCNSCliente
--
CREATE PROCEDURE CMRSPRCNSCliente(pConsulta INT,
 pIdTipoPersona INT,
  pestado INT,
  pDato VARCHAR(150))
BEGIN


  IF pConsulta = 1 THEN
    SELECT
      IdCliente

      ,
      Codigo
      ,
      IF(estado = 1, 'PREFERENCIAL', '') AS estado
      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono
      ,
      COALESCE(numero_ruc, '') AS numero_ruc
      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      IdTipoPersona AS TipoPersona
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
     ,Celular AS Celular

    FROM
      cmrt01_cliente;

  END IF;
  IF pConsulta = 2 THEN
    SELECT
      IdCliente

      ,
      Codigo
      ,
      IF(estado = 1, 'PREFERENCIAL', '') AS estado

      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono
      ,
      COALESCE(numero_ruc, '') AS numero_ruc
      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      IdTipoPersona AS TipoPersona
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
      ,Celular AS Celular

    FROM
      cmrt01_cliente
    WHERE

      numero_dni LIKE CONCAT('%', pDato, '%');
  END IF;

  IF pConsulta = 3 THEN
    SELECT
      IdCliente
      ,
      Codigo
      ,
      IF(estado = 1, 'PREFERENCIAL', '') AS estado
      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono
      ,
      COALESCE(numero_ruc, '') AS numero_ruc
      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      IdTipoPersona AS TipoPersona
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
      ,Celular AS Celular

    FROM
      cmrt01_cliente
    WHERE

      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) LIKE CONCAT('%', pDato, '%');
  END IF;
  IF pConsulta = 4 THEN
    SELECT
      IdCliente

      ,
      Codigo
      ,
      IF(estado = 1, 'PREFERENCIAL', '') AS estado
      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono
      ,
      COALESCE(numero_ruc, '') AS numero_ruc
      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      IdTipoPersona AS TipoPersona
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
      ,Celular AS Celular

    FROM
      cmrt01_cliente
    WHERE
      estado = pestado;
  END IF;
END
$$

