      ,
      IF(estado = 1, 'HABILITADO', 'DESABILITADO') AS estado

      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono

      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
    ,Celular AS Celular
    FROM
      cmrt03_empleado
    WHERE

      numero_dni LIKE CONCAT('%', pDato, '%');
  END IF;

  IF pConsulta = 3 THEN
    SELECT
      IdEmpleado
      ,
      Codigo
      ,
      IF(estado = 1, 'HABILITADO', 'DESABILITADO') AS estado
      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono
      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
      ,Celular AS Celular
    FROM
      cmrt03_empleado
    WHERE

      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) LIKE CONCAT('%', pDato, '%');
  END IF;
  IF pConsulta = 4 THEN
    SELECT
      IdEmpleado

      ,
      Codigo
      ,
      IF(estado = 1, 'HABILITADO', 'DESABILITADO') AS estado
      ,
      ApellidoPaterno
      ,
      ApellidoMaterno
      ,
      Nombre
      ,
      sexo
      ,
      COALESCE(direccion, '') AS direccion
      ,
      COALESCE(telefono, '') AS telefono
      ,
      COALESCE(numero_dni, '') AS numero_dni
      ,
      COALESCE(correo, '') AS correo
      ,
      CONCAT(ApellidoPaterno, ' ', ApellidoMaterno,
      ' ', Nombre) AS NombreCompleto
      ,Celular AS Celular

    FROM
      cmrt03_empleado
    WHERE
      estado = pestado;
  END IF;
END
