--
-- Definition for procedure CTBSPRCNSListarCuentasCorrienteConEquivalencias
--
CREATE PROCEDURE CTBSPRCNSListarCuentasCorrienteConEquivalencias()
BEGIN
  declare pIdCuentaCorriente int;
  declare pCliente VARCHAR(300);
  declare pSaldo NUMERIC(15,2);
  declare pSaldoEquivalente NUMERIC(15,2);
  declare pMoneda VARCHAR(30);
  declare pDNI VARCHAR(30);
  declare pIdMoneda INT;
  declare pIdCliente bigINT;

  declare done TINYINT default FALSE;
  declare cur CURSOR FOR
  select viw.IdCuentaCorriente,viw.Cliente,viw.Abreviatura,viw.Saldo,viw.IdMoneda,viw.Numero_DNI,viw.IdCliente from vtaviwcnscuentacorriente viw;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  drop TEMPORARY TABLE if exists tmpCuentaCorriente;
  create TEMPORARY table tmpCuentaCorriente
    (
      IdCuentaCorriente INT,
      Cliente varchar(3000),
      Moneda VARCHAR(100),      
      Saldo NUMERIC(15,2),
      TipoCambio NUMERIC(15,2),
      SaldoEnSoles NUMERIC(15,2),
      IdMoneda int,
      IdCliente bigint
    );
  OPEN cur;
  loop1:loop  
  FETCH cur INTO pIdCuentaCorriente,pCliente,pMoneda,pSaldo,pIdMoneda,pDNI,pIdCliente;
  IF done THEN
    CLOSE cur;
    LEAVE loop1;
  END IF;
   BEGIN
   declare tipoCambio NUMERIC(15,2);
   set tipoCambio=(select ome.UltimoMontoVentaMN from vtat03_moneda ome where ome.IdMoneda=pIdMoneda);
   


   end;  
  END LOOP loop1;
  SELECT * FROM tmpCuentaCorriente tmp ORDER BY tmp.Cliente ;
  
END
$$

