--
-- Definition for procedure CTBSPRINSCuentaCorriente
--
CREATE PROCEDURE CTBSPRINSCuentaCorriente(inout pIdCuentaCorriente int,pIdCliente BIGINT, pIdMoneda int, pMonto DECIMAL(10,4))
BEGIN
  
  declare vIdCuentaCorriente INT;

  SET vIdCuentaCorriente=(SELECT t02.IdCuentaCorriente FROM ctbt02_cuenta_corriente t02
                            where t02.IdCliente=pIdCliente and t02.IdMoneda=pIdMoneda);

  if vIdCuentaCorriente is NULL
    THEN
        values (pIdMoneda,pIdCliente,pMonto);
    SET pIdCuentaCorriente=last_insert_id();    
  else
      set pIdCuentaCorriente=vIdCuentaCorriente;
  end if;
END
$$

--
-- Definition for procedure CTBSPRINSDepositoCuentaCorriente
--
CREATE PROCEDURE CTBSPRINSDepositoCuentaCorriente(
  pIdCuentaCorriente INT,
  pMonto DECIMAL(10,2),    
  pIP VARCHAR(15),
  pIdEmpleado INT,
  pIdUsuario INT,
  pIdSucursal int,
  pIdCliente int,
  pIdMoneda int
)
BEGIN

declare pIdPuntoVenta INT;
DECLARE pIdIngresoFinanciero BIGINT;
declare pTipoCambio NUMERIC(15,2);
DECLARE pCodigoGenerado varchar(30);
declare pIdSerie INT;
set pTipoCambio=(select t03.UltimoMontoVentaMN from vtat03_moneda t03 where t03.IdMoneda=pIdMoneda);
set pIdPuntoVenta=(select viw.IdPuntoVenta
              from vtat11_punto_venta viw 
              where viw.IP=pIP and viw.IdSucursal=pIdSucursal );

  call VTASPRCNSGenerarNumComprobante(pIP,7,pCodigoGenerado,pIdSerie,pIdSucursal);

  update ctbt01_serie t01
    set t01.UltimoNumeroComprobante=t01.UltimoNumeroComprobante+1
  WHERE t01.IdSerie=pIdSerie;

  
    VALUES (pIdCuentaCorriente,null,4,1,pCodigoGenerado,pMonto,NOW(),pIdEmpleado,pIdUsuario);


    IdConceptoIngreso, 
    NumDoc, 
    IdCliente,
    IdMoneda, 
    TipoCambio,
    IdComprobanteVenta,
    Fecha, 
    Observacion,
    SubTotalNeto, 
    SubTotalNetoSinIGV,
    IGVActual, 
    IGV, 
    ISC,
    MontoTotal, TotalPago,
    VueltoTotal,IdSucursal,IdPuntoVenta,IdTipoComprobanteVenta,IdEmpleado,IdUsuario,IngresoTotalLiquido) 
    VALUES 
    (
    3, 
    pCodigoGenerado, 
    pIdCliente,
    pIdMoneda, 
    pTipoCambio,
    null,
    NOW(), 
    null,
    null, 
    null,
    null, 
    null, 
    null,
    pMonto, 
    pMonto, 
    0,
    pIdSucursal,
    pIdPuntoVenta,
    null,
    pIdEmpleado,
    pIdUsuario,pMonto);

  set pIdIngresoFinanciero:=LAST_INSERT_ID();

  IdIngresoFinanciero,
  IdTipoPago, 
  Monto, 
  Vuelto,
  IdInstituicionFinanciera, 
  IdCuentaEmpresa,
  FechaCheque, 
  CodigoAutorizacion,
  NumeroPago,IdPuntoVenta,IngresoLiquido)
  VALUES (
  pIdIngresoFinanciero,
  1, 
  pMonto, 
  0,
  1, 
  1,
  NULL, 
  NULL,
  NULL,
  pIdPuntoVenta,pMonto
  ); 
END
$$

