--
-- Definition for procedure GRLSPRCNSCondicionSistema
--
CREATE PROCEDURE GRLSPRCNSCondicionSistema(
  out pResultado int
)
BEGIN
 declare fechaActual datetime;
 declare fechaAperura datetime;
  declare fechaCerrado datetime;
 set fechaActual=date(NOW());
 set fechaAperura=(select grl.FechaApertura from grlt11_atencion_sistema grl where date(grl.FechaApertura)=date(fechaActual));
 set fechaCerrado=(select grl.FechaClausura from grlt11_atencion_sistema grl where date(grl.FechaClausura)=date(fechaActual));
 if fechaAperura is NULL and fechaCerrado is null
  then
  set pResultado =1; -- sin aperturar
 else
    if fechaAperura is not NULL and fechaCerrado is null
    then
      set pResultado =2; -- sin cerrar
      else
    if fechaAperura is not NULL and fechaCerrado is not null
    then
      set pResultado =3; -- cerrada
    end if;
    end if;
  end if;
END
$$

--
-- Definition for procedure GRLSPRCNSConsultarCierreCajaFechaAnterior
--
CREATE PROCEDURE GRLSPRCNSConsultarCierreCajaFechaAnterior(pIdSucursal INT)
BEGIN

  declare pIdPuntoVenta int;
  declare pFecha DATETIME;
  DECLARE v_done    BOOL DEFAULT FALSE;
  declare cur_puntosventas cursor for 
  SELECT p.IdPuntoVenta from vtat11_punto_venta p where p.sino_caja=TRUE;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;
  set pFecha=(SELECT MAX(t11.FechaApertura) FROM grlt11_atencion_sistema t11); 
  open cur_puntosventas;
  loop1:loop 
  FETCH cur_puntosventas INTO pIdPuntoVenta;
  IF v_done THEN
    SET v_done := FALSE;
    CLOSE cur_puntosventas;
    LEAVE LOOP1;
  END IF;

  END LOOP loop1;



END
$$

