CREATE PROCEDURE OMESPRINSTipoCambioDia(
  pMontoCompraMN    DECIMAL(10,4),
  pMontoVentaMN     DECIMAL(10,4),
  pMontoCompraDolar DECIMAL(10,4),
  pMontoVentaDolar DECIMAL(10,4),
  pIdMoneda        INT,
