  )
BEGIN


     MontoVentaDolar,IdMoneda,IdUsuario,Fecha)
    VALUES (pMontoCompraMN,pMontoVentaMN,pMontoCompraDolar,
     pMontoVentaDolar,pIdMoneda,pIdUsuario,NOW());

  UPDATE vtat03_moneda SET
  UltimoMontoCompraMN =pMontoCompraMN,
  UltimoMontoVentaMN =pMontoVentaMN, 
  UltimoMontoCompraDolar =pMontoCompraDolar,
  UltimoMontoVentaDolar =pMontoVentaDolar,
  UltimoIdUsuario =pIdUsuario,
  UltimaFecha =NOW()
  WHERE   IdMoneda =pIdMoneda;
END
$$

--
-- Definition for procedure OMESPRINSUPDCambioDia
--
CREATE PROCEDURE OMESPRINSUPDCambioDia(IN pMontoCompraMN DECIMAL(10,4), IN pMontoVentaMN DECIMAL(10,4), IN pMontoCompraDolar DECIMAL(10,4), IN pMontoVentaDolar DECIMAL(10,4),
  IN pIdMoneda INT, IN pIdUsuario INT, paccionabm tinyint, pIdCambioDia bigint)
BEGIN


  if paccionabm=1 THEN
     MontoVentaDolar,IdMoneda,IdUsuario,Fecha)
    VALUES (pMontoCompraMN,pMontoVentaMN,pMontoCompraDolar,
     pMontoVentaDolar,pIdMoneda,pIdUsuario,NOW());

  UPDATE vtat03_moneda SET
  UltimoMontoCompraMN =pMontoCompraMN,
  UltimoMontoVentaMN =pMontoVentaMN, 
  UltimoMontoCompraDolar =pMontoCompraDolar,
  UltimoMontoVentaDolar =pMontoVentaDolar,
  UltimoIdUsuario =pIdUsuario,
  UltimaFecha =NOW()
  WHERE   IdMoneda =pIdMoneda;

  ELSE IF paccionabm =2 THEN

      UPDATE omet01_cambio_dia SET
      MontoCompraMN =pMontoCompraMN,
      MontoVentaMN =pMontoVentaMN, 
      MontoCompraDolar =pMontoCompraDolar,
      MontoVentaDolar =pMontoVentaDolar,
      IdUsuario =pIdUsuario,
      Fecha =NOW()
      WHERE   IdCambioDia =pIdCambioDia;

        UPDATE vtat03_moneda SET
      UltimoMontoCompraMN =pMontoCompraMN,
      UltimoMontoVentaMN =pMontoVentaMN, 
      UltimoMontoCompraDolar =pMontoCompraDolar,
      UltimoMontoVentaDolar =pMontoVentaDolar,
      UltimoIdUsuario =pIdUsuario,
      UltimaFecha =NOW()
      WHERE   IdMoneda =pIdMoneda;
      END IF;

END IF;

END
$$

