if pcns = 1 then
SELECT
     tcc.IdCuadreCaja, 
     tcc.UltimoIdEstado,
     tes.descripcion as Estado,
     DATE_FORMAT( tcc.FechaApertura,"%d/%m/%Y %r") as FechaApertura,
     COALESCE(DATE_FORMAT( tcc.FechaCierre,"%d/%m/%Y %r"),''),
     COALESCE(DATE_FORMAT( tcc.FechaCuadre,"%d/%m/%Y %r"),'')  
     
     
  FROM
      grlt01_estado  tes,
