                tsot01_cuadre_caja tcc
            WHERE DATE(tcc.FechaApertura)=pFecha AND
                  tcc.IdPuntoVenta=pIdPuntoVenta AND
                  tes.IdEstado=tcc.UltimoIdEstado
                ;

        end if;
 end if;
END
