--
-- Definition for procedure VTASPRCNSGenerarNumComprobante
--
CREATE PROCEDURE VTASPRCNSGenerarNumComprobante(
    pIP VARCHAR(100),
    pIdTipoComprobante INT,
    out pCodigoUltimoNumeroGenerado varchar(30),
    out pIdSerie int,
    pIdSucursal int
  )
BEGIN
  DECLARE pCodigoGenerado varchar(50) DEFAULT 1;  
  declare pIdPuntoVentaSerie INT;

  set pIdPuntoVentaSerie=(select viw.IdPuntoVentaSerie
              from vtaviwcnspuntoventa viw 
              where viw.IP=pIP and viw.IdTipoComprobante=pIdTipoComprobante and viw.IdSucursal=pIdSucursal);
  

  set pIdSerie=(select viw.IdSerie from vtaviwcnspuntoventa viw
                where viw.IdPuntoVentaSerie=pIdPuntoVentaSerie );

  
  set pCodigoGenerado=(select ALMFNCCNSObtenerCodigo(ctbt01_serie.Numero,2)
              from ctbt01_serie ctbt01_serie 
              where ctbt01_serie.IdSerie=pIdSerie);

  set pCodigoUltimoNumeroGenerado=(select concat(pCodigoGenerado,'-', viw.UltimoNumeroComprobante+1)
              from vtaviwcnspuntoventa viw 
              where viw.IdPuntoVentaSerie=pIdPuntoVentaSerie);
END
$$

