--
-- Definition for procedure VTASPRCNSPedido
--
CREATE PROCEDURE VTASPRCNSPedido(
 pIdCns TINYINT,
  pIdSucursal INT
  )
BEGIN
  
  if pIdCns=1 -- Ultima 1 dia
    THEN
      SELECT 
         vtaviw.IdPedido,
        vtaviw.IdCliente,
        vtaviw.IdSucursal,
        DATE_FORMAT( vtaviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        vtaviw.IdDescuento,
        vtaviw.Descuento,
        vtaviw.DescuentoEnValores,
        vtaviw.DescuentoEnSubTotal,
        vtaviw.DescuentoTotal,
        vtaviw.SubTotalNeto,
        vtaviw.SubTotalNetoSinIGV,
        vtaviw.IGVActual,
        vtaviw.IGV,
        vtaviw.ISC,
        vtaviw.MontoTotal,
        vtaviw.IdTipoComprobante,
        vtaviw.IdCondicion,
        vtaviw.IdMoneda, 
        vtaviw.TipoCambio,  
        vtaviw.Codigo,
        vtaviw.Cliente,
        vtaviw.Moneda,
        vtaviw.TipoComprobante,        
        vtaviw.Direccion,
        vtaviw.DNI,
        vtaviw.Condicion,
        vtaviw.`Tipo Descuento`, 
        vtaviw.EmpleadoAbre,
        vtaviw.IdEmpleado,
        vtaviw.Sucursal,
        vtaviw.SubtotalBruto,
        vtaviw.TotalPagar
        FROM vtaviwcnspedido vtaviw
      where 
        DATE_SUB(CURDATE(),INTERVAL 1 day)<=vtaviw.Fecha 
        and vtaviw.IdUltimoEstado=1
        order by vtaviw.Fecha asc ;

      else
  if pIdCns=2 -- Ultimo 3 Dia
    THEN
      SELECT 
          vtaviw.IdPedido,
        vtaviw.IdCliente,
        vtaviw.IdSucursal,
        DATE_FORMAT( vtaviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        vtaviw.IdDescuento,
        vtaviw.Descuento,
        vtaviw.DescuentoEnValores,
        vtaviw.DescuentoEnSubTotal,
        vtaviw.DescuentoTotal,
        vtaviw.SubTotalNeto,
        vtaviw.SubTotalNetoSinIGV,
        vtaviw.IGVActual,
        vtaviw.IGV,
        vtaviw.ISC,
        vtaviw.MontoTotal,
        vtaviw.IdTipoComprobante,
        vtaviw.IdCondicion,
        vtaviw.IdMoneda, 
        vtaviw.TipoCambio,  
        vtaviw.Codigo,
        vtaviw.Cliente,
        vtaviw.Moneda,
        vtaviw.TipoComprobante,        
        vtaviw.Direccion,
        vtaviw.DNI,
        vtaviw.Condicion,
        vtaviw.`Tipo Descuento`, 
        vtaviw.EmpleadoAbre,
        vtaviw.IdEmpleado,
        vtaviw.Sucursal,
        vtaviw.SubtotalBruto,
        vtaviw.TotalPagar   
        FROM vtaviwcnspedido vtaviw
      where 
        DATE_SUB(CURDATE(),INTERVAL 3 day)<=vtaviw.Fecha 
        and vtaviw.IdUltimoEstado=1
        order by vtaviw.Fecha asc;
    else
  if pIdCns=3 -- Todos
    THEN
      SELECT 
         vtaviw.IdPedido,
        vtaviw.IdCliente,
        vtaviw.IdSucursal,
        DATE_FORMAT( vtaviw.Fecha,"%d/%m/%Y %h:%m:%S"),
        vtaviw.IdDescuento,
        vtaviw.Descuento,
        vtaviw.DescuentoEnValores,
        vtaviw.DescuentoEnSubTotal,
        vtaviw.DescuentoTotal,
        vtaviw.SubTotalNeto,
        vtaviw.SubTotalNetoSinIGV,
        vtaviw.IGVActual,
        vtaviw.IGV,
        vtaviw.ISC,
        vtaviw.MontoTotal,
        vtaviw.IdTipoComprobante,
        vtaviw.IdCondicion,
        vtaviw.IdMoneda, 
        vtaviw.TipoCambio,  
        vtaviw.Codigo,
        vtaviw.Cliente,
        vtaviw.Moneda,
        vtaviw.TipoComprobante,        
        vtaviw.Direccion,
        vtaviw.DNI,
        vtaviw.Condicion,
        vtaviw.`Tipo Descuento`, 
        vtaviw.EmpleadoAbre,
        vtaviw.IdEmpleado,
        vtaviw.Sucursal ,
        vtaviw.SubtotalBruto,
        vtaviw.TotalPagar
        FROM vtaviwcnspedido vtaviw
      where 
        vtaviw.IdUltimoEstado=1
        order by vtaviw.Fecha asc;
    END IF;
    END IF;
    END IF;
END
$$

