--
-- Definition for procedure VTASPRINSComprobanteDetalle
--
CREATE PROCEDURE VTASPRINSComprobanteDetalle(
pIdComprobanteVenta BIGINT,
pIdPedidoDetalleRef BIGINT,
pIdProducto INT,
pIdAlmacen INT,
pIdUnidadMedidaVenta INT,
pCantidad DECIMAL(10,4),
pPrecio DECIMAL(10, 4),
pImporteSinDescuento DECIMAL(10, 4),
pIdDescuento TINYINT,
pDescuento DECIMAL(10,4),
pDescuentoEnValores DECIMAL(10,4),
pImporteConDescuento DECIMAL(10, 4),
pExonerado decimal(10,4),
pSiNoImpuesto bool
)
BEGIN

    vtat09_comprobante_venta_detalle    
     (IdComprobanteVenta, 
     IdPedidoDetalleRef,
     IdProducto,
     IdAlmacen,
     IdUnidadMedidaVenta,
     Cantidad, 
     Precio, 
     ImporteSinDescuento,
     IdDescuento,
     Descuento,
     DescuentoEnValores,
     ImporteConDescuento,
     Exonerado,
      sinoImpuesto
     )
     VALUES
    (
     pIdComprobanteVenta, 
     pIdPedidoDetalleRef,
     pIdProducto,
     pIdAlmacen,
     pIdUnidadMedidaVenta,
     pCantidad, 
     pPrecio, 
     pImporteSinDescuento,
     pIdDescuento,
     pDescuento,
