--
-- Definition for procedure VTASPRINSComprobanteVenta
--
CREATE PROCEDURE VTASPRINSComprobanteVenta(INOUT pIdComprobanteVenta BIGINT, IN pIdComprobanteVentaRef BIGINT, IN pIdCondicion INT, IN pUltimoIdEstado INT, IN pUltimoIdEstadoComprobanteVenta INT, IN pIdTipoComprobante INT, IN pIdEmpleado INT, IN pIdUsuario INT, IN pIdCliente INT, IN pIdSucursal INT, IN pIdPedidoRef BIGINT, IN pIdMoneda INT, IN pTipoCambio decimal(10,2), IN pSubtotalBruto NUMERIC(10,2), IN pIdDescuento INT, IN pDescuento NUMERIC(10,2), IN pDescuentoEnValores NUMERIC(10,2), IN pDescuentoEnSubtotal NUMERIC(10,2), IN pDescuentoTotal NUMERIC(10,2), IN pSubTotalNeto NUMERIC(10,2), IN pSubTotalNetoSinIGV NUMERIC(10,2), IN pIGVActual NUMERIC(10,2), IN pIGV NUMERIC(10,4), IN pISC NUMERIC(10,4), IN pMontoTotal NUMERIC(10,4), IN pIP VARCHAR(100), OUT pNumeroComprobante varchar(30),pTotalCobrar NUMERIC(10,4))
BEGIN
  
  DECLARE codigo varchar(50) DEFAULT 1;  
  declare pIdSerie INT;
  
  call VTASPRCNSGenerarNumComprobante(pIP,pIdTipoComprobante,codigo,pIdSerie,pIdSucursal);

  update ctbt01_serie t01
    set t01.UltimoNumeroComprobante=t01.UltimoNumeroComprobante+1
  WHERE t01.IdSerie=pIdSerie;

  if pIdCondicion= 1
    then
    begin          
          DECLARE pIdCuentaCorriente INT;          
          declare vIdComprobanteVenta  BIGINT;
          IdCondicion,
          UltimoIdEstado,           
          IdTipoComprobante, 
          NumComprobante, 
          IdMoneda,TipoCambio,
          IdEmpleado, 
          IdUsuario, IdCliente, IdSucursal,Fecha, IdPedidoRef,SubTotalBruto,
          IdDescuento, Descuento,DescuentoEnValores,DescuentoEnSubTotal,
          DescuentoTotal,SubTotalNeto,SubTotalNetoSinIGV,
          IGVActual,IGV,ISC,MontoTotal,UltimaFecha,UltimoIdUsuario,
          TotalCobrar
            ) 
          VALUES 
           (
          pIdComprobanteVentaRef,
          pIdCondicion,
          1,
          pIdTipoComprobante,
          codigo, 
          pIdMoneda,
          pTipoCambio,
          pIdEmpleado,
          pIdUsuario, 
          pIdCliente,
          pIdSucursal, NOW(),pIdPedidoRef,pSubTotalBruto,pIdDescuento,
          pDescuento,pDescuentoEnValores,pDescuentoEnSubtotal,pDescuentoTotal,
          pSubTotalNeto,pSubTotalNetoSinIGV,pIGVActual,pIGV,pISC,pMontoTotal,now(),pIdUsuario,pTotalCobrar);
          set pIdComprobanteVentaRef=last_insert_id();   
        
      SET pIdComprobanteVenta=pIdComprobanteVentaRef;
      call VTASPRINSPedidoEstado(pIdPedidoRef,2,pIdUsuario,pIdEmpleado,NULL);
      set pNumeroComprobante:=(codigo);
    end;
  end if;
  
END
$$

