--
-- Definition for procedure VTASPRINSFormaPago
--
CREATE PROCEDURE VTASPRINSFormaPago(OUT pIdIdFormaPago BIGINT,
  pIdConceptoPago INT,
  pNumDoc VARCHAR(30),
  pIdCliente INT, 
  pIdMoneda INT,
  pTipoCambio DECIMAL(10, 2),
  pIdComprobanteVenta BIGINT, 
  pObservacion VARCHAR(300), 
  pSubTotalNeto DECIMAL(10, 2),
  pSubTotalNetoSinIGV DECIMAL(10, 2),
  pIGVActual DECIMAL(10, 2),
  pIGV DECIMAL(10, 2), 
  pISC DECIMAL(10, 2),
  pMontoTotal DECIMAL(10, 2),
  pVueltoTotal DECIMAL(10, 2),
  pIP VARCHAR(15),
  pIdSucursal INT,
  OUT pIdPuntoVenta INT,
  pIdTipoComprobanteVenta INT, 
  pIdEmpleado INT,
  pIdUsuario INT,
  out pIdIngresoFinanciero bigint,
  pMontoSinCuentaCorriente NUMERIC(15,2),
  pIngresoTotalLiquido NUMERIC(10,2),
  pIngresoTotalLiquidoSinCuentaCorriente NUMERIC(15,2),
  pTotalPago NUMERIC(15,2),
  pTotalPagoSinCuentaCorriente NUMERIC(15,2)
  )
BEGIN
  SET pIdPuntoVenta =
  (SELECT
    viw.IdPuntoVenta
  FROM
    vtat11_punto_venta viw
  WHERE
    viw.IP = pIP AND viw.IdSucursal = pIdSucursal);

    IdConceptoPago, NumDoc, IdCliente, IdMoneda, TipoCambio, IdComprobanteVenta, Fecha, Observacion, SubTotalNeto, SubTotalNetoSinIGV, IGVActual, IGV, ISC, MontoTotal, VueltoTotal, IdSucursal, IdPuntoVenta, IdTipoComprobanteVenta, IdEmpleado, IdUsuario,IngresoTotalLiquido,IngresoTotalLiquidoSinCuentaCorriente,TotalPago,TotalPagoSinCuentaCorriente) VALUES (
    pIdConceptoPago, pNumDoc, pIdCliente, pIdMoneda, pTipoCambio, pIdComprobanteVenta, NOW(), pObservacion, pSubTotalNeto, pSubTotalNetoSinIGV, pIGVActual, pIGV, pISC, pMontoTotal, pVueltoTotal, pIdSucursal, pIdPuntoVenta, pIdTipoComprobanteVenta, pIdEmpleado, pIdUsuario,pIngresoTotalLiquido,pIngresoTotalLiquidoSinCuentaCorriente,pTotalPago,pTotalPagoSinCuentaCorriente);
  SET pIdIdFormaPago := LAST_INSERT_ID();
  if pMontoSinCuentaCorriente<>0
    then
    call VTASPRINSIngresoFinanciero(pIdIngresoFinanciero,1, pNumDoc, pIdCliente, pIdMoneda , pTipoCambio, pIdComprobanteVenta , pObservacion, pSubTotalNeto-(pMontoTotal-pMontoSinCuentaCorriente) , pSubTotalNeto+(pMontoTotal-pMontoSinCuentaCorriente)-pIGV , pIGVActual , pIGV , pISC , pMontoSinCuentaCorriente, pVueltoTotal , pIP , pIdSucursal , pIdPuntoVenta,pIdTipoComprobanteVenta , pIdEmpleado , pIdUsuario ,pIdIdFormaPago,pIngresoTotalLiquidoSinCuentaCorriente,pTotalPagoSinCuentaCorriente);
    end if;
END
$$

--
-- Definition for procedure VTASPRINSFormaPagoDetalle
--
CREATE PROCEDURE VTASPRINSFormaPagoDetalle(pIdFormaPago BIGINT(20),
  pIdTipoIngreso INT(11),
  pMonto INT(11),
  pVuelto DECIMAL(10, 2),
  pIdInstituicionFinanciera INT(11),
  pIdCuentaEmpresa INT(11), 
  pFechaCheque DATETIME,
  pCodigoAutorizacion VARCHAR(50),
  pNumeroPago VARCHAR(100),
  pIdPuntoVenta INT,
  pIdComprobanteVentaRef BIGINT,
  pNumComprobanteVenta VARCHAR(30),
  pIdMoneda INT,
  pIdCliente BIGINT, 
  pIdUsuario INT,
  pIdEmpleado INT,
  pIdIngresoFinanciero BIGINT(20),
  pIngresoLiquido NUMERIC(10,2)
  )
BEGIN

  DECLARE pIdCuentaCorriente INT;
  declare pIdFormaPagoDetalle BIGINT;
    IdFormaPago, IdTipoPago, Monto, Vuelto, IdInstituicionFinanciera, IdCuentaEmpresa, FechaCheque, CodigoAutorizacion, NumeroPago, IdPuntoVenta,IngresoLiquido) VALUES (
    pIdFormaPago, pIdTipoIngreso, pMonto, pVuelto, pIdInstituicionFinanciera, pIdCuentaEmpresa, pFechaCheque, pCodigoAutorizacion, pNumeroPago, pIdPuntoVenta,pIngresoLiquido
    );
 set pIdFormaPagoDetalle=LAST_INSERT_ID();
 if pIdTipoIngreso=4 
  THEN    
    CALL CTBSPRINSCuentaCorriente(pIdCuentaCorriente,pIdCliente,pIdMoneda,0);
    CALL CTBSPRINSMovimientoCuenta(pIdCuentaCorriente,pIdComprobanteVentaRef,3,2,pNumComprobanteVenta,pMonto,pIdUsuario,pIdEmpleado);      
     
  ELSE
          call VTASPRINSIngresoFinancieroDetalle(pIdIngresoFinanciero, pIdTipoIngreso , pMonto , pVuelto, pIdInstituicionFinanciera, pIdCuentaEmpresa, pFechaCheque, pCodigoAutorizacion, pNumeroPago, pIdPuntoVenta, pIdComprobanteVentaRef, pNumComprobanteVenta, pIdMoneda, pIdCliente, pIdUsuario, pIdEmpleado,pIdFormaPagoDetalle,pIngresoLiquido);
          CALL CTBSPRINSCuentaCorriente(pIdCuentaCorriente,pIdCliente,pIdMoneda,0);
          CALL CTBSPRINSMovimientoCuenta(pIdCuentaCorriente,NULL,4,1,pNumComprobanteVenta,pIngresoLiquido,pIdUsuario,pIdEmpleado);       
          CALL CTBSPRINSMovimientoCuenta(pIdCuentaCorriente,pIdComprobanteVentaRef,3,2,pNumComprobanteVenta,pIngresoLiquido,pIdUsuario,pIdEmpleado);
    END IF;

END
$$

