    pIdPuntoVenta,pIdTipoComprobanteVenta,pIdEmpleado,pIdUsuario,pIdFormaPago,pIngresoTotalLiquidoSinCuentaCorriente,pTotalPago,1);
  set pIdIngresoFinanciero:=LAST_INSERT_ID();
END
