--
-- Definition for procedure VTASPRINSPedido
--
CREATE PROCEDURE VTASPRINSPedido(
     pIdPedido             BIGINT,
     pIdCliente            BIGINT,
     pIdSucursal           TINYINT,
     pDescuento            DECIMAL(10, 2),
     pSubTotalNeto             DECIMAL(10, 2),
     pIdUltimoEstado       TINYINT,
     pIdTipoComprobante    TINYINT,
     pIdCondicion          TINYINT,
     pIdMoneda             TINYINT,
     pIdDescuento          TINYINT,
 inOUT pIdPedido_aux         BIGINT,
 inOUT pCodigoPedido         VARCHAR(11),
     pIdEmpleado           int,
     pIdUsuario            int,
     pTipoCambio           DECIMAL(10, 3),
     pSubtotalBruto        DECIMAL(10, 2),
     pDescuentoEnSubTotal  DECIMAL(10, 2),
     pDescuentoTotal       DECIMAL(10, 2),
     pDescuentoEnValores   DECIMAL(10, 2),
     VIGVActual            DECIMAL(10, 2),
     vImporteIGV           DECIMAL(10, 2),
     vSubTotalNetoSinIGV   DECIMAL(10, 2),
     vMontoTotal           DECIMAL(10, 2),
     pTotalPagar           DECIMAL(10, 2)
  )
BEGIN



    SET pCodigoPedido:=(select ALMFNCCNSObtenerCodigo((Select (valor+1) from grlt02_correlativo where IdCorrelativo=6),2));

    UPDATE grlt02_correlativo SET valor=CAST(pCodigoPedido AS DECIMAL(10,0))where IdCorrelativo=6;

          isc,SubTotalNetoSinIGV, IdUltimoEstado, IdTipoComprobante,
          IdCondicion, IdMoneda, IdDescuento,Codigo,MontoTotal,
          IdEmpleado,IdUsuario,IGVActual,TipoCambio,
          SubtotalBruto,DescuentoEnSubTotal,DescuentoTotal,
          DescuentoEnValores,UltimaFecha,UltimoIdUsuario,
          UltimoIdEmpleado,TotalPagar)
          VALUES (pIdCliente, pIdSucursal, NOW(), pDescuento,
          pSubTotalNeto,vImporteIGV,0,vSubTotalNetoSinIGV,
          pIdUltimoEstado, pIdTipoComprobante, pIdCondicion,
          pIdMoneda,pIdDescuento,pCodigoPedido,vMontoTotal,
          pIdEmpleado,pIdUsuario,VIGVActual,pTipoCambio,
          pSubtotalBruto,pDescuentoEnSubTotal,pDescuentoTotal,
          pDescuentoEnValores,now(),pIdUsuario,pIdEmpleado,
          pTotalPagar);

    SET pIdPedido_aux :=
    (SELECT
      LAST_INSERT_ID());

     call VTASPRINSPedidoEstado(pIdPedido_aux,1,pIdUsuario,pIdEmpleado,'');



END
$$

