--
-- Definition for procedure VTASPRINSPedidoEstado
--
CREATE PROCEDURE VTASPRINSPedidoEstado(
     pIdPedido             BIGINT,
     pIdEstado            INT,
     pIdUsuario            int,
     pIdEmpleado            int,
     pdescripcion        VARCHAR(250))
BEGIN

    if pIdEstado= 0 then -- modificado

       UPDATE vtat15_pedido_estado  SET
       IdEmpleado            = pIdEmpleado,
       IdUsuario             = pIdUsuario,
       fecha                 = now()
       WHERE IdPedido=pIdPedido AND IdEstado=1;
       set pIdEstado:=1;

      else

          VALUES (pIdPedido, pIdEstado, pIdUsuario, pIdEmpleado,now(), pdescripcion);
        end if;

   UPDATE vtat05_pedido  SET
       IdUltimoEstado        = pIdEstado,
       UltimoIdEmpleado      = pIdEmpleado,
       UltimoIdUsuario       = pIdUsuario,
       UltimaFecha           = now()
    WHERE IdPedido=pIdPedido;

END
$$

--
-- Definition for procedure VTASPRRPTCierreCaja
--
CREATE PROCEDURE VTASPRRPTCierreCaja(IN pFecha VARCHAR(18), IN pIdPuntoVenta INT)
BEGIN
SELECT



  tif.Sucursal,
  tif.TipoComprobante,
  tif.NumDoc,
  tif.Moneda,
  tif.AbreviaturaMoneda,
  tif.PuntoVenta,
  if(tif.UltimoIdEstadoComprobante = 4, 0, MontoTotal) AS MontoTotal,
  if(tif.UltimoIdEstadoComprobante = 4, 0, TotalPago) AS TotalPago,
  if(tif.UltimoIdEstadoComprobante = 4, 0, VueltoTotal) AS VueltoTotal,
  if(tif.UltimoIdEstadoComprobante = 4, 0, IngresoTotalLiquido) AS IngresoTotalLiquido,
  CONCAT(ApellidoPaterno,' ',ApellidoMaterno,' ',Nombre) AS Cliente,
   tifd.IdTipoPago,
   tifd.TipoPago,
   tifd.Monto,
   tifd.Vuelto,
   tifd.IngresoLiquido,
   tif.Fecha,
  tif.UltimoEstadoComprobante



FROM
   vtaviwcnsingresofinanciero tif,
   vtaviwcnsingresofinancierodetalle  tifd ,
   cmrt01_cliente             tcl
   
WHERE
  date(tif.Fecha)=pFecha and  
  tif.IdPuntoVenta=pIdPuntoVenta AND
  tcl.IdCliente=tif.IdCliente  AND
  tif.IdIngresoFinanciero=tifd.IdIngresoFinanciero
 
   order by tif.IdMoneda,tif.IdTipoComprobanteVenta
;
END
$$

