--
-- Definition for procedure VTASPRRPTListadoComprobantesAnuladosDetalle
--
CREATE PROCEDURE VTASPRRPTListadoComprobantesAnuladosDetalle(IN pFecha datetime, pIdSucursal INT)
BEGIN
    DECLARE pSucursal VARCHAR(300);

  SET pSucursal :=
  (SELECT
    t01.Descripcion
  FROM
    vtat01_sucursal t01
  WHERE
    t01.IdSucursal = pIdSucursal);
  SELECT
    vta.Moneda,
    vta.MonedaDesc,
    vta.IdMoneda,
    vta.NumComprobante as 'Codigo',
    vta.Cliente,
    vta.SubTotalNetoSinIGV,
    vta.IGV,
    vta.ISC,
    vta.MontoTotal,
    DATE_FORMAT(vta.Fecha, "%d/%m/%Y") as fecha,
    DATE_FORMAT(pFecha, "%d/%m/%Y") AS pFechaCorrecta,
    pSucursal,
    vta.TipoComprobante
  FROM
    vtaviwcnscomprobanteventa vta
  WHERE
    vta.IdSucursal = pIdSucursal AND
    DATE(vta.UltimaFecha) = date(pFecha) AND
    vta.UltimoIdEstado =4 ;

END
$$

