      WHERE tup.IdProducto= vcd.IdProducto AND
            tup.SiNoUnidadBase= true AND 
            tup.IdUnidadMedidaVenta=tum.IdUnidadMedidaVenta)

   AS 'Unidad Base', 
  (SELECT tup.EquivalenciaConBase FROM almt15_unidad_medida_producto tup
     WHERE tup.IdProducto=vcd.IdProducto
         AND tup.IdUnidadMedidaVenta=vcd.IdUnidadMedidaVenta)
     as 'Equi',
   SUM((SELECT CAST(tup.EquivalenciaConBase*vcd.Cantidad AS DECIMAL(10,2))FROM almt15_unidad_medida_producto tup
     WHERE tup.IdProducto=vcd.IdProducto
         AND tup.IdUnidadMedidaVenta=vcd.IdUnidadMedidaVenta)) as 'CantidaTotal',
   SUM(COALESCE(vcd.ImporteConDescuento,0)+COALESCE(vcd.Exonerado,0)) as 'Monto Total'
  FROM
    vtaviwcnscomprobanteventadetalle vcd,
    vtaviwcnscomprobanteventa        vcv,
    almt05_producto tp
    where 
    date(vcv.Fecha)>=pFechaInicial AND
    date(vcv.Fecha)<=pFechaFinal AND
    vcv.UltimoIdEstado=1 AND
    vcv.IdComprobanteVenta=vcd.IdComprobanteVenta AND
    tp.IdProducto = vcd.IdProducto
    Group by vcd.IdProducto
    order by CantidaTotal,vcd.IdProducto
    LIMIT 10;
    Else if ptop=20 then
              SELECT  

              vcd.IdProducto,
              tp.Descripcion,
              vcv.Moneda as`Simbolo`,
              (SELECT
                tum.Abreviatura AS UMB
                FROM
                   almt15_unidad_medida_producto tup,
                    almt08_unidad_medida_venta  tum
                  WHERE tup.IdProducto= vcd.IdProducto AND
                        tup.SiNoUnidadBase= true AND 
                        tup.IdUnidadMedidaVenta=tum.IdUnidadMedidaVenta)
            
               AS 'Unidad Base', 
            
               SUM((SELECT CAST(tup.EquivalenciaConBase*(vcd.Cantidad) AS DECIMAL(10,2))FROM almt15_unidad_medida_producto tup
                 WHERE tup.IdProducto=vcd.IdProducto
                     AND tup.IdUnidadMedidaVenta=vcd.IdUnidadMedidaVenta)) as 'CantidaTotal',
               SUM(COALESCE(vcd.ImporteConDescuento,0)+COALESCE(vcd.Exonerado,0)) as 'Monto Total'
              FROM
                vtaviwcnscomprobanteventadetalle vcd,
                vtaviwcnscomprobanteventa        vcv,
                almt05_producto tp
                where 
                date(vcv.Fecha)>=pFechaInicial AND
                date(vcv.Fecha)<=pFechaFinal AND
                vcv.UltimoIdEstado=1 AND
                vcv.IdComprobanteVenta=vcd.IdComprobanteVenta AND
                tp.IdProducto = vcd.IdProducto
                Group by vcd.IdProducto
                order by CantidaTotal,vcd.IdProducto
                LIMIT 20;
          else if ptop=50 then
                  SELECT  
    
                  vcd.IdProducto,
                  tp.Descripcion,
                  vcv.Moneda as`Simbolo`,
                  (SELECT
                    tum.Abreviatura AS UMB
                    FROM
                       almt15_unidad_medida_producto tup,
                        almt08_unidad_medida_venta  tum
                      WHERE tup.IdProducto= vcd.IdProducto AND
                            tup.SiNoUnidadBase= true AND 
                            tup.IdUnidadMedidaVenta=tum.IdUnidadMedidaVenta)
                
                   AS 'Unidad Base', 
                
                   SUM((SELECT CAST(tup.EquivalenciaConBase*vcd.Cantidad AS DECIMAL(10,2))FROM almt15_unidad_medida_producto tup
                     WHERE tup.IdProducto=vcd.IdProducto
                         AND tup.IdUnidadMedidaVenta=vcd.IdUnidadMedidaVenta)) as 'CantidaTotal',
                   SUM(COALESCE(vcd.ImporteConDescuento,0)+COALESCE(vcd.Exonerado,0)) as 'Monto Total'
                  FROM
                    vtaviwcnscomprobanteventadetalle vcd,
                    vtaviwcnscomprobanteventa        vcv,
                    almt05_producto tp
                    where 
                    date(vcv.Fecha)>=pFechaInicial AND
                    date(vcv.Fecha)<=pFechaFinal AND
                    vcv.UltimoIdEstado=1 AND
                    vcv.IdComprobanteVenta=vcd.IdComprobanteVenta AND
                    tp.IdProducto = vcd.IdProducto
                    Group by vcd.IdProducto
                    order by CantidaTotal,vcd.IdProducto
                    LIMIT 50;
                end if;

          end if;
    end if;
    
END
$$

--
-- Definition for procedure VTASPRRPTListadoProductosMasVendidosPorUnidadPorFechaExacta
--
CREATE PROCEDURE VTASPRRPTListadoProductosMasVendidosPorUnidadPorFechaExacta(IN pFechaInicial VARCHAR(18), IN pidProducto BIGINT)
BEGIN
  SELECT  
  vcv.Moneda as`Simbolo`,
  vcd.AbreviaturaUM AS Unidad,
SUM((SELECT CAST(tup.EquivalenciaConBase*vcd.Cantidad AS DECIMAL(10,2))FROM almt15_unidad_medida_producto tup
     WHERE tup.IdProducto=vcd.IdProducto
         AND tup.IdUnidadMedidaVenta=vcd.IdUnidadMedidaVenta)) as 'CantidaTotal',
  SUM(vcd.Cantidad) as 'CantidadUMB',
--  SUM(vcd.Cantidad) as 'CantidaTotal',
  SUM(COALESCE(vcd.ImporteConDescuento,0)+COALESCE(vcd.Exonerado,0)) as 'Monto Total'
FROM
  vtaviwcnscomprobanteventadetalle vcd,
  vtaviwcnscomprobanteventa        vcv
  where 
  date(vcv.Fecha)=pFechaInicial AND
   vcv.UltimoIdEstado=1 AND
  vcd.IdProducto = pidProducto AND
  vcv.IdComprobanteVenta=vcd.IdComprobanteVenta 
  Group by vcd.IdProducto,vcd.IdUnidadMedidaVenta
  order by CantidaTotal,vcd.IdProducto

  
  ;
END
$$

