--
-- Definition for procedure VTASPRRPTListadoVentasPorEmpleado
--
CREATE PROCEDURE VTASPRRPTListadoVentasPorEmpleado(IN pFechaInicial VARCHAR(18),
  IN pFechaFinal VARCHAR(18),
  in pIdEstado tinyint,
  in pIdEmpleado int)
BEGIN
     

  DROP TEMPORARY TABLE IF EXISTS  t_pedido;
  CREATE TEMPORARY TABLE t_pedido(
    Fecha           VARCHAR(15),
    IdPedido        BIGINT,
    Codigo          VARCHAR(15),
    TipoComprobante VARCHAR(50),
    IdMoneda        TINYINT,
    IdSucursal      TINYINT,
    Moneda          VARCHAR(10),
    MonedaDesc      VARCHAR(50),
    SubTotalNeto    DECIMAL(10,2),
    DescuentoTotal  DECIMAL(10,2),
    MontoTotal      DECIMAL(10,2),
    Sucursal        VARCHAR(50),
    Condicion       VARCHAR(50),
    Empleado        VARCHAR(250),
    UltimoEstado    VARCHAR(50),
    NumDoc          VARCHAR(50)
    );


  if pIdEstado =0 then
                       SubTotalNeto,DescuentoTotal,MontoTotal,Sucursal,Condicion,
                       Empleado,UltimoEstado,NumDoc)
    SELECT
        vp.IdPedido,
        DATE_FORMAT( vp.Fecha,"%d/%m/%Y") as 'Fecha',
        vp.Codigo as 'N° Pedido',
        vp.TipoComprobante,
        vp.IdMoneda,
        vp.IdSucursal,
        vp.Moneda as 'Moneda',
        vp.MonedaDesc as 'MonedaDesc',
        vp.SubTotalNeto,
        vp.DescuentoTotal,
        vp.MontoTotal,
        vp.Sucursal,
        vp.Condicion,
        vp.Empleado,
        vp.UltimoEstado as 'Estado Actual',
            '0'         AS 'N° Doc.'
      
        
        FROM
          vtaviwcnspedido  vp
        where 
          date(vp.Fecha)>=pFechaInicial AND
          date(vp.Fecha)<=pFechaFinal AND
          vp.IdEmpleado=pIdEmpleado
          ;
          ELSE  IF pIdEstado=1 then 
                       SubTotalNeto,DescuentoTotal,MontoTotal,Sucursal,Condicion,
                       Empleado,UltimoEstado,NumDoc)
                        SELECT
                            vp.IdPedido,
                            DATE_FORMAT( vp.Fecha,"%d/%m/%Y") as 'Fecha',
                            vp.Codigo as 'N° Pedido',
                            vp.TipoComprobante,
                            vp.IdMoneda,
                            vp.IdSucursal,
                            vp.Moneda as 'Moneda',
                            vp.MonedaDesc as 'MonedaDesc',
                            vp.SubTotalNeto,
                            vp.DescuentoTotal,
                            vp.MontoTotal,
                            vp.Sucursal,
                            vp.Condicion,
                            vp.Empleado,
                            vp.UltimoEstado as 'Estado Actual',
                                '0'         AS 'N° Doc.'
                          
                            
                            FROM
                              vtaviwcnspedido  vp
                            where 
                               vp.IdUltimoEstado= 2 AND
                              date(vp.Fecha)>=pFechaInicial AND
                              date(vp.Fecha)<=pFechaFinal AND
                              vp.IdEmpleado=pIdEmpleado
                              ;

             end if; 
    end if;

  DROP TEMPORARY TABLE IF EXISTS  t_comprobante;
  CREATE TEMPORARY TABLE t_comprobante(
    IdPedidoRef     BIGINT, 
    NumComprobante  VARCHAR(50)
    );



  SELECT tcp.IdPedidoRef,tcp.NumComprobante
  FROM
         vtat08_comprobante_venta   tcp,
          vtat05_pedido             tp
        where 
          tp.IdEmpleado=pIdEmpleado   AND
          date(tp.Fecha)>=pFechaInicial AND
          date(tp.Fecha)<=pFechaFinal AND
          tp.IdPedido=tcp.IdPedidoRef
          
  ;


     SELECT

        tp.Fecha as 'Fecha',
        tp.Codigo as 'N° Pedido',
        tp.TipoComprobante,
        tp.IdMoneda,
        tp.Moneda as 'Moneda',
        tp.MonedaDesc as 'Moneda2',
        tp.SubTotalNeto,
        tp.DescuentoTotal,
        tp.MontoTotal,
        tp.Sucursal,
        tp.Condicion,
        tp.Empleado,
        tp.UltimoEstado as 'Estado Actual',
        COALESCE(tcp.NumComprobante,'')   AS 'N° Doc.'
      
        
       FROM
        t_comprobante    tcp  
        
       RIGHT OUTER JOIN
       t_pedido  tp      
       ON 
       tp.IdPedido=tcp.IdPedidoRef
       order by tp.IdSucursal,tp.IdMoneda;



END
$$

