CREATE PROCEDURE VTASPRRPTNumVentasCategoria(pIdConsulta int,pIdRubro int,pFecha1 datetime,pfecha2 datetime)
BEGIN
   IF pIdConsulta = 1 THEN
    begin
    declare vIdCategoria int;
    declare vIdRubro int;
    declare vCategoria varchar(300);
    declare vCodigo varchar(15);      
    declare vCantidad NUMERIC(10,2);
    declare vNumVentas NUMERIC(10,2);
    declare v_done boolean default false ;
    declare cur_Categoria cursor for 
    SELECT
    rub.IdCategoria,
    rub.Codigo,
    rub.Descripcion,rub.IdRubro from
    almt02_Categoria rub where rub.IdRubro=pIdRubro or rub.IdCategoria=1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;   
    drop table if exists tbltmpCategoriaVentas;
    create TEMPORARY table if not exists tbltmpCategoriaVentas
    (
      IdCategoria int,
      IdRubro int,
      Categoria VARCHAR(300),
      Codigo VARCHAR(15),
      NumVentas NUMERIC(10,2),
      Cantidad NUMERIC(10,2)
    );
     open cur_Categoria;
     loop1:loop
     FETCH cur_Categoria INTO vIdCategoria,vCodigo,vCategoria,vIdRubro;
     if v_done 
      THEN
        LEAVE loop1;
      end if;
      begin       
      declare v_done2 boolean default false;
      declare cur_venta cursor for 
      SELECT count(*),sum(viw.Cantidad)
      from vtaviwcomprobanteventa_matriz viw, almt05_producto t05
      where t05.IdProducto=viw.IdProducto and t05.IdCategoria=vIdCategoria and date(viw.Fecha)=pFecha1 and t05.IdRubro=pIdRubro
      group by t05.IdCategoria ;
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done2 = TRUE;   
      open cur_venta;      
      FETCH cur_venta INTO vCantidad,vNumVentas;      
      if vCantidad is null
        THEN
        set vCantidad=(0);
        end if;
      if vNumVentas is null
        THEN
        set vNumVentas=(0);
        end if;
      CLOSE cur_venta;  
      end; 
            set vNumVentas=(null);
            set vCantidad=(null);
     end loop loop1;  
      select * from tbltmpCategoriaVentas;
    end;    
    else
    IF pIdConsulta = 2 THEN
    begin
    declare vIdCategoria int;
    declare vIdRubro int;
    declare vCategoria varchar(300);
    declare vCodigo varchar(15);      
    declare vCantidad NUMERIC(10,2);
    declare vNumVentas NUMERIC(10,2);
    declare v_done boolean default false ;
    declare cur_Categoria cursor for 
    SELECT
    rub.IdCategoria,
    rub.IdRubro,
    rub.Codigo,
    rub.Descripcion from
    almt02_Categoria rub where rub.IdRubro=pIdRubro;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;   
    drop table if exists tbltmpCategoriaVentas;
    create TEMPORARY table if not exists tbltmpCategoriaVentas
    (
      IdCategoria int,
      IdRubro int,
      Categoria VARCHAR(300),
      Codigo VARCHAR(15),
      NumVentas NUMERIC(10,2),
      Cantidad NUMERIC(10,2)
    );
     open cur_Categoria;
     loop1:loop
     FETCH cur_Categoria INTO vIdCategoria,vIdRubro,vCodigo,vCategoria;
     if v_done 
      THEN
        LEAVE loop1;
      end if;
      begin       
      declare v_done2 boolean default false;
      declare cur_venta cursor for 
      SELECT count(*),sum(viw.Cantidad)
      from vtaviwcomprobanteventa_matriz viw, almt05_producto t05
      where t05.IdProducto=viw.IdProducto and t05.IdCategoria=vIdCategoria and date(viw.Fecha)>=pFecha1 and date(viw.Fecha)<=pFecha2 and t05.IdRubro=pIdRubro
      group by t05.IdCategoria ;
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done2 = TRUE;   
      open cur_venta;      
      FETCH cur_venta INTO vCantidad,vNumVentas;      
      if vCantidad is null
        THEN
        set vCantidad=(0);
        end if;
      if vNumVentas is null
        THEN
        set vNumVentas=(0);
        end if;
      CLOSE cur_venta;  
      end; 
            set vNumVentas=(null);
            set vCantidad=(null);
     end loop loop1;  
      select * from tbltmpCategoriaVentas;
    end;
    END IF;
  END IF;
END
$$

