--
-- Definition for procedure VTASPRRPTNumVentasSubfamilia
--
CREATE PROCEDURE VTASPRRPTNumVentasSubfamilia(pIdConsulta int,pIdRubro int,pIdCategoria int,pIdFamilia int,pFecha1 datetime,pfecha2 datetime)
BEGIN
   IF pIdConsulta = 1 THEN
    begin
    declare vIdSubfamilia int;
    declare vSubfamilia varchar(300);
    declare vCodigo varchar(15);      
    declare vCantidad NUMERIC(10,2);
    declare vNumVentas NUMERIC(10,2);
    declare v_done boolean default false ;
    declare cur_Subfamilia cursor for 
    SELECT
    rub.IdSubfamilia,
    rub.Codigo,
    rub.Descripcion from
    almt04_Subfamilia rub where rub.IdFamilia=pIdFamilia or rub.IdSubfamilia=1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;   
    drop table if exists tbltmpSubfamiliaVentas;
    create TEMPORARY table if not exists tbltmpSubfamiliaVentas
    (
      IdSubfamilia int,
      Subfamilia VARCHAR(300),
      Codigo VARCHAR(15),
      NumVentas NUMERIC(10,2),
      Cantidad NUMERIC(10,2)
    );
     open cur_Subfamilia;
     loop1:loop
     FETCH cur_Subfamilia INTO vIdSubfamilia,vCodigo,vSubfamilia;
     if v_done 
      THEN
        LEAVE loop1;
      end if;
      begin       
      declare v_done2 boolean default false;
      declare cur_venta cursor for 
      SELECT count(*),sum(viw.Cantidad)
      from vtaviwcomprobanteventa_matriz viw, almt05_producto t05
      where t05.IdProducto=viw.IdProducto 
      and t05.IdSubfamilia=vIdSubfamilia 
      and date(viw.Fecha)=pFecha1 and 
      t05.IdRubro=pIdRubro and 
        t05.IdCategoria=pIdCategoria and 
        t05.IdFamilia=pIdFamilia
      group by t05.IdSubfamilia ;
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done2 = TRUE;   
      open cur_venta;      
      FETCH cur_venta INTO vCantidad,vNumVentas;      
      if vCantidad is null
        THEN
        set vCantidad=(0);
        end if;
      if vNumVentas is null
        THEN
        set vNumVentas=(0);
        end if;
      CLOSE cur_venta;  
      end; 
            set vNumVentas=(null);
            set vCantidad=(null);
     end loop loop1;  
      select * from tbltmpSubfamiliaVentas;
    end;    
    else
    IF pIdConsulta = 2 THEN
    begin
    declare vIdSubfamilia int;
    declare vSubfamilia varchar(300);
    declare vCodigo varchar(15);      
    declare vCantidad NUMERIC(10,2);
    declare vNumVentas NUMERIC(10,2);
    declare v_done boolean default false ;
    declare cur_Subfamilia cursor for 
    SELECT
    rub.IdSubfamilia,
    rub.Codigo,
    rub.Descripcion from
    almt04_Subfamilia rub where rub.IdCategoria=pIdCategoria or rub.IdSubfamilia=1;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done = TRUE;   
    drop table if exists tbltmpSubfamiliaVentas;
    create TEMPORARY table if not exists tbltmpSubfamiliaVentas
    (
      IdSubfamilia int,
      Subfamilia VARCHAR(300),
      Codigo VARCHAR(15),
      NumVentas NUMERIC(10,2),
      Cantidad NUMERIC(10,2)
    );
     open cur_Subfamilia;
     loop1:loop
     FETCH cur_Subfamilia INTO vIdSubfamilia,vCodigo,vSubfamilia;
     if v_done 
      THEN
        LEAVE loop1;
      end if;
      begin       
      declare v_done2 boolean default false;
      declare cur_venta cursor for 
      SELECT count(*),sum(viw.Cantidad)
      from vtaviwcomprobanteventa_matriz viw, almt05_producto t05
      where t05.IdProducto=viw.IdProducto and t05.IdSubfamilia=vIdSubfamilia and date(viw.Fecha)>=pFecha1 and date(viw.Fecha)<=pFecha2 and t05.IdRubro=pIdRubro and t05.IdCategoria=pIdCategoria and t05.IdFamilia=pIdFamilia
      group by t05.IdSubfamilia ;
      DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_done2 = TRUE;   
      open cur_venta;      
      FETCH cur_venta INTO vCantidad,vNumVentas;      
      if vCantidad is null
        THEN
        set vCantidad=(0);
        end if;
      if vNumVentas is null
        THEN
        set vNumVentas=(0);
        end if;
      CLOSE cur_venta;  
      end; 
            set vNumVentas=(null);
            set vCantidad=(null);
     end loop loop1;  
      select * from tbltmpSubfamiliaVentas;
    end;
    END IF;
  END IF;
END
$$

