--
CREATE PROCEDURE VTASPRUPDPedido(
     pIdPedido             BIGINT,
     pIdCliente            BIGINT,
     pIdSucursal           TINYINT,
     pDescuento            DECIMAL(10, 2),
     pSubTotalNeto         DECIMAL(10, 2),
     pIdUltimoEstado       TINYINT,
     pIdTipoComprobante    TINYINT,
     pIdCondicion          TINYINT,
     pIdMoneda             TINYINT,
     pIdDescuento          TINYINT,
     pIdEmpleado           int,
     pIdUsuario            int,
     pTipoCambio           DECIMAL(10, 3),
     pSubtotalBruto        DECIMAL(10, 2),
     pDescuentoEnSubTotal  DECIMAL(10, 2),
     pDescuentoTotal       DECIMAL(10, 2),
     pDescuentoEnValores   DECIMAL(10, 2),
     VIGV                  DECIMAL(10, 2),
     vImporteIGV           DECIMAL(10, 2),
     vSubTotalNetoSinIGV   DECIMAL(10, 2),   
     vMontoTotal           DECIMAL(10, 2),
     pTotalPagar           DECIMAL(10, 2))
BEGIN


    UPDATE vtat05_pedido  SET

       IdCliente             = pIdCliente,
       IdSucursal            = pIdSucursal,
       Fecha                 = NOW(),
       Descuento             = pDescuento,
