       IGV                   = vImporteIGV,
       isc                   = 0,
       SubTotalNetoSinIGV    = vSubTotalNetoSinIGV,
       IdUltimoEstado        = pIdUltimoEstado,
       IdTipoComprobante     = pIdTipoComprobante,
       IdCondicion           = pIdCondicion,
       IdMoneda              = pIdMoneda,
       IdDescuento           = pIdDescuento,
       MontoTotal            = vMontoTotal,
       IdEmpleado            = pIdEmpleado,
       IdUsuario             = pIdUsuario,
       IGVActual             = VIGV,
       TipoCambio            =pTipoCambio ,
       SubtotalBruto         =pSubtotalBruto,
       DescuentoEnSubTotal   =pDescuentoEnSubTotal,
       DescuentoTotal        =pDescuentoTotal,
       DescuentoEnValores    =pDescuentoEnValores,
       TotalPagar           =pTotalPagar

    WHERE IdPedido=pIdPedido;

    -- SET pIdPedido_aux :=  pIdPedido;

      DELETE FROM vtat06_pedido_detalle
      WHERE IdPedido=pIdPedido;

call VTASPRINSPedidoEstado(pIdPedido,0,pIdUsuario,pIdEmpleado,'');


END
$$

--
-- Definition for function ALMFNCCNSObtenerCodigo
--
CREATE FUNCTION ALMFNCCNSObtenerCodigo(
  codigo int ,
 opcion int )
  RETURNS varchar(11) CHARSET latin1
  DETERMINISTIC
  READS SQL DATA
BEGIN

      if opcion= 1 then
          if codigo<10 then
              return CONCAT('0',codigo);
          else
                return codigo;
          end if;
     ELSE

        if opcion= 2 then

            if codigo<10 then
              return CONCAT('00',codigo);

          else

                 if codigo<100 then
                  return CONCAT('0',codigo);
                    ELSE
                        return codigo;

                  end if;

          end if;

      end if;


  end if;


return '';
END
$$

